import React, { useState, useEffect } from 'react';
import axios from 'axios';

function OrderItemsList() {
  const [orderItems, setOrderItems] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/order-items')
      .then(response => {
        setOrderItems(response.data);
      })
      .catch(error => {
        console.error('Błąd podczas pobierania zamówień:', error);
      });
  }, []);

  return (
    <div>
      <h2>Lista zamówień</h2>
      <ul>
        {orderItems.map(item => (
          <li key={item.zamowienie_id}>
            Zamówienie {item.zamowienie_id}: klient {item.klient_id}, produkt {item.produkt_id}, ilość {item.iloc}, wartość {item.wartosc} zł, status: {item.status}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default OrderItemsList;
